    panel.restore();
    sound.restore();
    surface.restore();
    svCheats.restore();
    viewRender.restore();
    networkChannel.restore();


    netvars->restore();

    Glow::clearCustomObjects();

    SetWindowLongPtrW(window, GWLP_WNDPROC, LONG_PTR(originalWndProc));
